      .content-container {
        display: flex;
        color: white;
        padding: 40px;
        width: 100%;
        height: 100%;
        flex-direction: column;
      }

      .title,
      .sub-title {
        color: #fe8c0a;
      }

      .title {
        font-size: 65px;
        font-weight: 700;
        line-height: 105px;
        letter-spacing: 0.05em;
        text-align: center;
      }

      .sub-title {
        text-align: center;
        font-weight: 700;
        font-size: 32px;
        line-height: 48px;
      }

      .users {
        display: flex;
        align-items: center;
        gap: 130px;
        justify-content: center;
      }

      .user {
        display: flex;
        align-items: center;
        flex-direction: column;
        gap: 20px;
      }

      .user-name {
        font-style: normal;
        font-weight: 800;
        font-size: 40px;
        line-height: 60px;
        color: #fe277b;
        min-height: 60px;
        max-height: 120px;
        max-width: 100%;
        text-align: center;
      }

      .user-image {
        position: relative;
        width: 100%;
        height: 100%;
      }

      .image {
        border: 5px solid #fe8c0a;
        position: absolute;
        top: 42px;
        left: 42px;
        border-radius: 50%;
        width: 300px;
        height: 300px;
        background-position: center;
        background-size: cover;
        background-repeat: no-repeat;
      }

      .heart {
        padding-top: 35px;
      }

      .text-curve {
        font-style: normal;
        font-weight: 700;
        font-size: 36px;
        line-height: 34px;
        letter-spacing: 7px;
        font-family: "SF Pro Display", sans-serif;
      }

      .blockhain {
        padding: 10px 80px;
        padding-bottom: 20px;
        display: flex;
        gap: 400px;
        position: relative;
      }

      .stamp {
        position: absolute;
        left: 40%;
        top: 15px;
      }

      .stamp-code {
        position: absolute;
        top: 10px;
        left: 11px;
      }

      .stamp-curve {
        font-family: "Inter";
        font-style: normal;
        font-weight: 700;
        font-size: 11px;
        line-height: 13px;
        letter-spacing: 5px;
      }

      .section {
        display: flex;
        flex-direction: column;
      }

      .section-info {
        display: flex;
        gap: 5px;
      }

      .section-name,
      .section-data {
        font-size: 32px;
        font-weight: 700;
        line-height: 48px;
      }

      .section-name {
        color: #fe8c0a;
      }

      .section-data {
        color: #fe277b;
      }

      .stamp-hearts {
        position: absolute;
        top: 46px;
        left: 47px;
      }

      .stamp-logo {
        position: absolute;
        top: 30px;
        left: 33px;
      }

      .w3id {
        position: absolute;
        top: 10px;
        left: 41%;
        font-size: 24px;
        font-weight: 600;
        line-height: 36px;
        text-align: center;
        color: #fe277b;
        mix-blend-mode: normal;
      }
    </style>
    <title>Certificate</title>
